import styled from "styled-components";
import "./App.css";
import { Button } from "react-bootstrap";
import { BrowserRouter, Link } from "react-router-dom";

const Title = styled.div`
  padding-top: 20px;
  padding-bottom: 20px;
  text-align: center;
  font-size: 60px;
  color: white;
  font-family: "Amatic SC", cursive;
`;

const NewTask = styled.div`
  text-align: center;
`;

const AllTasks = styled.div`
  text-align: center;
`;

const Completed = styled.div`
  display: grid;
  justify-comtent: center;
  color: white;
`;

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Title>Feladatok</Title>
        <Completed>
          <Link to="/uncompleted">
            <Button className="Uncompleted" variant="dark">
              Elvégzendő feladatok
            </Button>
          </Link>

          <Link to="/completed">
            <Button className="Completed" variant="dark">
              Teljesített feladatok
            </Button>
          </Link>
          <Button className="All" variant="dark">
            Összes feladat
          </Button>
          <Button variant="dark">Feladat hozzáadása</Button>
        </Completed>
      </div>
    </BrowserRouter>
  );
}

export default App;
